window.bookSummaryJSON = "<p>Placed in an experimental medpod controlled by an advanced artificial intelligence, 93-year-old Colonel James Raytak continues the fight to repair his failing body.</p> <p>Leading his forces inside the game of <i>Limitless Lands</i> is helping the AI to heal his mind, but new threats are looming on the horizon.&nbsp;</p> <p>Forces both in and out of the game have begun their plans of conquest. Colonel Raytak must rely on his soldiers, his friends, and decades of real-world combat experience to face these new challenges.&nbsp;</p> <p>Find out who will rise to conquer in <i>Conquest</i>!</p>"; 
